        [Alias('Name', 'Identity')]
        [String[]]
        $ObJecTNAME,

        [ValidateNotNullOrEmpty()]
        [String]
        $DoMaIN,

        [ValidateNotNullOrEmpty()]
        [Alias('DomainController')]
        [String]
        $SERVeR,

        [ManAgEmENT.aUtoMaTiOn.PSCREDEntiAL]
        [Management.Automation.CredentialAttribute()]
        $CREdeNTIal = [ManAgEmENT.aUtoMaTiOn.PSCREDEntiAL]::Empty
    )

    BEGIN {
        $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn = @{}
        if ($pSBounDParAMeTERs['Domain']) { $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn['Domain'] = $DoMaIN }
        if ($pSBounDParAMeTERs['Server']) { $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn['Server'] = $SERVeR }
        if ($pSBounDParAMeTERs['Credential']) { $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn['Credential'] = $CREdeNTIal }
    }

    PROCESS {
        ForEach ($obJeCt in $ObJecTNAME) {
            $obJeCt = $obJeCt -Replace '/','\'

            if ($pSBounDParAMeTERs['Credential']) {
                $DN = eUaNTVSINrWQiZWlXfJfXVOdcyyQrhtqLfxdigVw -Identity $obJeCt -OutputType 'DN' @DomainSearcherArguments
                if ($DN) {
                    $uSERDoMaIN = $DN.SubString($DN.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'
                    $ = $DN.Split(',')[0].split('=')[1]

                    $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn['Identity'] = $
                    $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn['Domain'] = $uSERDoMaIN
                    $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn['Properties'] = 'objectsid'
                    FzMbPatOBPPfWafDrmNEBmJiLLYgrZnDtytShpIM @DomainSearcherArguments | Select-Object -Expand objectsid
                }
            }
            else {
                try {
                    if ($obJeCt.Contains('\')) {
                        $DoMaIN = $obJeCt.Split('\')[0]
                        $obJeCt = $obJeCt.Split('\')[1]
                    }
                    elseif (-not $pSBounDParAMeTERs['Domain']) {
                        $qEFnVUJ41iHraprG4Aw62ttE1RJ9xAQIjChMgrQv9tpqkCt5iQrKVDDBHyDHVYXfZqFn = @{}
                        $DoMaIN = (Get-Domain @DomainSearcherArguments).Name
                    }

                    $obJ = (New-Object sYsTEm.SEcURity.PRiNciPal.NtACcoUnt($DoMaIN, $obJeCt))
                    $obJ.Translate([SYStEM.SeCuriTY.priNCIPAL.sEcuRITyIDEntIfiER]).Value
                }
                catch {
                    Write-Verbose "[OwMpyvGYssndZKBBGXYljAacsRPLWfvTqJjOkizCe] Error converting $DoMaIN\$obJeCt : $_"
                }
            }
        }
    }
}


